import React from 'react'

class App extends React.Component{

    constructor(props){
        super(props);
        this.state = {
          data: 'Jordan Belfort'
        }
    }

    getData(){
        setTimeout(() => {
          console.log('Our data is fetched');
          this.setState({
            data: 'Hello WallStreet'
          })
        }, 1000)
    }

      componentDidMount(){
        this.getData();
      }

    render(){
        return(
            <>
                <div>Test111</div>
                {this.state.data}
                <div>Test112</div>
            </>


        )
    }
}

export default App
